import React, { Component} from 'react';
//import { render } from '@testing-library/react';

class BitcoinPrice extends Component {
   constructor(props) {
      super(props) ;

         this.state = {
            data : [],
            isLoaded : false,
         }
}

fetchData() {
   fetch('https://api.coingecko.com/api/v3/exchange_rates')
   .then(res => res.json() ) 
   .then(json => {
      console.log(json["rates"]["btc"]) 
      this.setState ({
        isLoaded: true,
        data: json,
     })
   });
}


componentDidMount() {

   this.fetchData();
   var {data}= this.state
   console.log(data[0])
}

render() {
   var{isLoaded, data}= this.state;
   if(!isLoaded) {
      return <div> Loading....</div>
   }
   else {
      return null;
   }
}

}
export default BitcoinPrice;;

